(15, 1, '2023-10-06 16:17:59', '2023-10-06 16:17:59', '<!-- wp:paragraph -->\n<p>HTML (Hypertext Markup Language) is a standard markup language used for creating and structuring content on the World Wide Web. It consists of a set of tags and elements that define the structure and presentation of web documents. HTML is the backbone of webpages, allowing text, images, links, and multimedia elements to be displayed and organized within a web browser. It provides a hierarchical structure that web browsers use to render content, making it a fundamental language for building websites and web applications.</p>\n<!-- /wp:paragraph -->', 'HTML', 'These are html tutorials', 'publish', 'open', 'open', '', 'html', '', '', '2023-10-06 16:17:59', '2023-10-06 16:17:59', '', 0, 'http://localhost/wordpress/?p=15', 0, 'post', '', 0),
